import React from "react";
import { carouselDB } from "../../carouselDB";

export const Carousel = () => {
  return (
    <>
      {carouselDB?.map(({ id, name, image }) => (
        <div className="carousel">
          <figure>
            <img src={img} alt="" />
          </figure>
        </div>
      ))}
    </>
  );
};
